The first officer on the flight was Yonas Mekuria (34). The first occurred 12 April 1992 on Flight ETH574, a Boeing 727-260. Two hijackers with hand grenades demanded to be taken to Nairobi and onwards to Canada. Five hijackers demanded to be taken to Libya, and the airplane was diverted to El Obeid, Sudan. There the hijackers changed their mind and wanted to fly to Sweden instead. However, the Sudanese authorities refused to refuel the aircraft, and after several hours of standoff the hijackers surrendered. They realized the flight had been hijacked when Mohamed Atta's announcements for passengers were unintentionally transmitted to air traffic control. On board, flight attendants Amy Sweeney and Betty Ong contacted American Airlines, and provided information about the hijackers and injuries to passengers and crew. ; Born: Penny Marshall, American actress and film director, in New York City (d. 2018) 

 // Air Canada Flight 621 on 5 July 1970 from Montreal to Los Angeles, called the "Champagne Flight" due to its typical fun-loving, holiday crowd, was set to make a scheduled stop in Toronto when disaster struck. The captain managed to pull the damaged plane around for another attempt at landing, but as he did so the plane began to disintegrate in the air 

 United Arab Airlines Flight 869 was an international scheduled passenger flight operated by a de Havilland DH-106 Comet 4C from Hong Kong via Bangkok to Cairo. On July 19, 1962 at 13:30 UTC, the plane departed from Hong Kong for the first leg of the flight with 18 passengers and 8 crew aboard. The flight was uneventful until commencing approach to Bangkok, when the plane crashed in the Khao Yai mountain range 96 km NE of Bangkok at 15:44 UTC.
